  false,\n\t\"url\": null,\n\t\"notes\": \"The objective of this investigation was
  to determine water quality problems or potential problems caused by agricultural
  drainage water entering the Modoc National Wildlife Refuge and the Ash Creek Wildlife
  Management Area. During 1987, the water supplies entering the Modoc National Wildlife
  Refuge and the Ash Creek Wildlife Management Area were sampled for pesticides and
  heavy metals conceivably associated with agricultural drainage. Purpose of the sampling
  was to determine if concentrations of toxic substances were present that would pose
  a threat to fish and wildlife. Sampling was done in January and June corresponding
  to the primary periods of chemical application in the watershed areas. Only pesticides
  used currently or previously in the areas were analyzed. Samples did not contain
  pesticides at detectable concentrations. Metal results were similar to background
  levels for surface waters in the Pit River system. Board staff concludes that agricultural
  chemical use or other toxics do not pose a threat to fish and wildlife in the two
  areas. Accordingly, additional intensive monitoring does not appear to be a priority
  activity unless chemical usage changes in the watersheds supplying the wildlife
  areas.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
